import { Card } from "../component/Component";
function Home() {
    return (
        <div className="w-full h-screen">
            <div className="grid grid-cols-2 sm:grid-cols-3 lg:grid-cols-4 gap-4 justify-items-center">
                <Card bgColor="green-500" text="white" title="Welcome to UKS Dashboard" class="w-full h-full" />
                <Card bgColor="blue-500" text="white" title="Data Siswa" class="w-full h-full" />
                <Card bgColor="yellow-500" text="white" title="Data Kesehatan" class="w-full h-full" />
                {/* Jika jumlah Card tidak kelipatan 3, Card ini akan di tengah */}
            </div>
        </div>
    );
}
export default Home;
